Quando começou no automobilismo, Raulino Kreis Junior tinha 27 anos. Hoje, aos 40 anos, Kreis Jr, como é conhecido no meio das corridas, é natural de Jaraguá do Sul, onde mantém residência. É casado há 17 anos com Mara Rosana Vieira Kreis, de quem recebe apoio incondicional nas disputas. Também tem duas filhas, Julia Carolina Vieira Kreis (13 anos) e a pequena Laura Valentina Vieira Kreis, de apenas 1 ano. Quando não está no automobilismo, Kreis gosta de viajar.
Principais conquistas
desde o início, em 1999:
2000, 2001 e 2003 - 03 vice-campeonatos Catarinense de Marcas.
2004, 2005, 2006 e 2007 - Diversos pódios na Copa Clio;
 2008 - 3o. lugar no Campeonato Paranaense de Marcas;
 2009 e 2010 - Categoria Pick-up Racing, atual Copa Montana e Troféu Linea;
 2011 - Stock-car na categoria Mini Challenge: 1o. lugar na 6a. etapa. 3o. colocado na 2a. etapa.
